def _hierarchical_split(count_dict, horizontal=True, gap=0.05):
    def split_rect(rect, horizontal, gap):
        x, y, w, h = rect
        if horizontal:
            split = w / (1 + gap)
            return [(x, y, split, h), (x + split + gap * split, y, w - split - gap * split, h)]
        else:
            split = h / (1 + gap)
            return [(x, y, w, split), (x, y + split + gap * split, w, h - split - gap * split)]

    def recursive_split(count_dict, rect, horizontal, gap):
        if len(count_dict) == 1:
            return {next(iter(count_dict)): rect}
        else:
            subcategories = list(count_dict.keys())
            total_count = sum(count_dict.values())
            counts = array([count_dict[cat] for cat in subcategories], float)
            counts /= total_count
            cum_counts = cumsum(counts)
            split_rects = split_rect(rect, horizontal, gap)
            subrects = {}
            for i, subrect in enumerate(split_rects):
                subcounts = {cat: count for cat, count in zip(subcategories, counts) if cum_counts[i - 1] < count <= cum_counts[i]}
                subrects.update(recursive_split(subcounts, subrect, not horizontal, gap))
            return subrects

    base_rect = recursive_split(count_dict, (0, 0, 1, 1), horizontal, gap)
    return base_rect

