    p, k, _ = coefs.shape
    if nlags is None:
        nlags = p
    acf = np.zeros((nlags + 1, k, k))
    for h in range(nlags + 1):
        for i in range(p):
            if h - i >= 0:
                acf[h] += np.dot(coefs[i], np.dot(acf[h - i], coefs[i].T))
        acf[h] += np.dot(np.dot(coefs.sum(axis=0), acf[h - 1]), coefs.sum(axis=0).T) + sig_u
    return acf

