def dentonm(indicator, benchmark, freq='aq', **kwargs):
    def denton(indicator, benchmark, k):
        n = len(indicator)
        m = len(benchmark)
        if n == m:
            return indicator
        elif n > m:
            return dot(benchmark, solve(dot(eye(m) + k * ones((m, m)), benchmark.T).T))
        else:
            return dot(solve(dot(eye(n) + k * ones((n, n)), indicator.T).T, indicator), benchmark)

    if freq == 'aq':
        k = 3
    elif freq == 'qm':
        k = 4
    elif freq == 'other':
        k = kwargs.get('k', 1)
    else:
        raise ValueError("Invalid frequency conversion specified.")

    if benchmark.ndim == 1:
        return denton(indicator, benchmark, k)
    else:
        return np.array([denton(indicator, b, k) for b in benchmark])

