def arma_acovf(ar, ma, nobs=10, sigma2=1, dtype=None):
    ar = np.asarray(ar)
    ma = np.asarray(ma)
    k_ar = ar.shape[0]
    k_ma = ma.shape[0]
    k = max(k_ar, k_ma)
    if k_ar == 1 and ar[0] == 0 and k_ma == 1 and ma[0] == 0:
        return np.array([sigma2] + [0] * (nobs - 1))
    if not np.all(np.abs(np.roots(np.r_[1, -ar])) < 1):
        raise ValueError("Non-stationary starting autoregressive parameters found with roots outside unit circle")
    if not np.all(np.abs(np.roots(np.r_[1, -ma])) < 1):
        raise ValueError("Non-stationary starting moving average parameters found with roots outside unit circle")
    if sigma2 <= 0:
        raise ValueError("sigma2 must be positive")
    cov = signal.convolve(np.r_[1, -ar], np.r_[1, ma], mode='full')
    acov = np.zeros(nobs)
    acov[0] = cov[k]
    for i in range(1, nobs):
        acov[i] = np.dot(acov[:i][::-1], ar[:i]) + cov[k + i]
    return acov
